import { moduleMetadata } from '@storybook/angular';
import { InfoListComponent } from './info-list.component';
import { PrimeIcons } from 'primeng/api';
const meta = {
    title: 'Display/Infolist',
    component: InfoListComponent,
    tags: ['autodocs'],
    decorators: [moduleMetadata({ imports: [] })],
    argTypes: {
        wrapperClassNames: { description: 'Custom CSS classes as component wraps' },
        classNames: { description: 'Custom CSS classes' },
        items: { description: 'Map object with data informations' }
    },
    parameters: {
        docs: {
            description: {
                component: `Component used to show a list of informations with relative icons.<br>
 							An **[items]** array data list is needed for set datas with a specific icon choosen 
							from [PrimeNg Icons](https://www.primefaces.org/primeng/icons).`,
            }
        },
    },
};
export default meta;
export const _InfoListComponent = {
    args: {
        wrapperClassNames: '',
        classNames: '',
        items: [
            { icon: PrimeIcons.CALENDAR, label: "October 3, 2022 to August 11, 2024" },
            { icon: PrimeIcons.MAP_MARKER, label: 'Paris, France' },
            { icon: PrimeIcons.LINK, label: 'https://www.wiz-team.com/' }
        ],
    },
};
